import './App.css';
import data from './data/Wine-Data.json'

function App() {
  const alcoholList = data.reduce((result,alcohol)=>{
    const alcoholClass = alcohol.Alcohol
    if(!result[alcoholClass]){
      result[alcoholClass] =[]
    }
    result[alcoholClass].push(alcohol)
    return result
  },{})
  //console.log(alcoholList)
  function getMean (keyprop){
    let result
    Object.entries(alcoholList).map((key)=>{
      if(key[0]===keyprop){
        let ap = key[1].map((alcohol)=>{
          return alcohol.Alcohol
        })
        result = ap.reduce((result,ap)=>result+ap)
      }

    })
    return result
  }
  return (
    <div className="App">
      <h1>Wine Data</h1>
      <table>
        <thead>
            <th>Measure</th>
            {Object.keys(alcoholList).map((key)=><th>Class {key}</th>)}
        </thead>
        <tbody>
            <tr>
              <td>Mean</td>
              {Object.keys(alcoholList).map((key, index)=>{<td>{getMean(key)}</td>})}
            </tr>
            <tr>
              <td>Median</td>
            </tr>
            <tr>
              <td>Mode</td>
            </tr>
        </tbody>
      </table>
    </div>
  );
}

export default App;
